import React from "react";

const Searchresult = ( props ) => {
  // const searchData = location.state.data;
  const resultdata1 = location.state && location.state.resultdata1;
  const resultdata2 = location.state && location.state.resultdata2;
  const resultdata3 = location.state && location.state.resultdata3;

  if (!resultdata1 || !resultdata2 || !resultdata3) {
    return <div>결과가 없습니다</div>;
  }  

  return (
    <div>
      <h2>Search Results</h2>
      {/* Render the search results */}
      <ul>
        {/* Use resultdata1, resultdata2, resultdata3 to render data */}
        {/* For example: */}
        {resultdata1.map((result, index) => (
          <li key={index}>{result}</li>
        ))}
      </ul>
    </div>
  );
};

export default Searchresult;
